  left:0;
  background:#fff;
  z-index:10;
  box-shadow: 0 0 10px rgba(0,0,0,0.5);
`;


const BasicHeader = () => {
  return  <LayoutHeader>
  홈페이지헤더
</LayoutHeader>  
}
